import React, { useState } from "react";
import { useNavigate, Link } from "react-router-dom";
import axios from "axios";
import Swal from "sweetalert2";

const Register = () => {
  const [formData, setFormData] = useState({
    primerNombre: "",
    segundoNombre: "",
    primerApellido: "",
    segundoApellido: "",
    identificacion: "",
    email: "",
    fechaNacimiento: "",
    ubicacion: {
      lugar: "",
      ciudad: "",
      departamento: "",
    },
    usuario: {
      login: "",
      password: "",
    },
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => {
      if (name.startsWith("ubicacion.")) {
        const [_, field] = name.split(".");
        return {
          ...prevData,
          ubicacion: {
            ...prevData.ubicacion,
            [field]: value,
          },
        };
      } else if (name.startsWith("usuario.")) {
        const [_, field] = name.split(".");
        return {
          ...prevData,
          usuario: {
            ...prevData.usuario,
            [field]: value,
          },
        };
      } else {
        return {
          ...prevData,
          [name]: value,
        };
      }
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("http://localhost:9001/Laboratorio1/persona", formData);
      Swal.fire({
        icon: "success",
        title: "Registro exitoso",
        text: "La persona ha sido registrada correctamente.",
      });
      navigate("/"); // Redirige al home después de registrar
    } catch (error) {
      if (error.response && error.response.status === 409) {
        Swal.fire({
          icon: "error",
          title: "Error de registro",
          text: "Conflicto: El usuario ya existe.",
        });
      } else {
        Swal.fire({
          icon: "error",
          title: "Error de registro",
          text: "Hubo un problema al registrar la persona.",
        });
      }
    }
  };

  return (
    <div className="container mt-5">
      <h2>Registrar Persona</h2>
      <form onSubmit={handleSubmit}>
        {/* Campos del formulario */}
        <div className="form-group">
          <label>Primer Nombre</label>
          <input
            type="text"
            name="primerNombre"
            className="form-control"
            value={formData.primerNombre}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Segundo Nombre</label>
          <input
            type="text"
            name="segundoNombre"
            className="form-control"
            value={formData.segundoNombre}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label>Primer Apellido</label>
          <input
            type="text"
            name="primerApellido"
            className="form-control"
            value={formData.primerApellido}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Segundo Apellido</label>
          <input
            type="text"
            name="segundoApellido"
            className="form-control"
            value={formData.segundoApellido}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label>Identificación</label>
          <input
            type="text"
            name="identificacion"
            className="form-control"
            value={formData.identificacion}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Email</label>
          <input
            type="email"
            name="email"
            className="form-control"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Fecha de Nacimiento</label>
          <input
            type="date"
            name="fechaNacimiento"
            className="form-control"
            value={formData.fechaNacimiento}
            onChange={handleChange}
            required
          />
        </div>

        {/* Campos de Ubicación */}
        <div className="form-group">
          <label>Lugar</label>
          <input
            type="text"
            name="ubicacion.lugar"
            className="form-control"
            value={formData.ubicacion.lugar}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Ciudad</label>
          <input
            type="text"
            name="ubicacion.ciudad"
            className="form-control"
            value={formData.ubicacion.ciudad}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Departamento</label>
          <input
            type="text"
            name="ubicacion.departamento"
            className="form-control"
            value={formData.ubicacion.departamento}
            onChange={handleChange}
            required
          />
        </div>

        {/* Campos de Usuario */}
        <div className="form-group">
          <label>Usuario (Login)</label>
          <input
            type="text"
            name="usuario.login"
            className="form-control"
            value={formData.usuario.login}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Password</label>
          <input
            type="password"
            name="usuario.password"
            className="form-control"
            value={formData.usuario.password}
            onChange={handleChange}
            required
            autoComplete="current-password"
          />
        </div>

        <button type="submit" className="btn btn-primary mt-3">
          Registrar
        </button>
        <Link to="/" className="btn btn-secondary mt-3 ml-2">
          Regresar al Home
        </Link>
      </form>
    </div>
  );
};

export default Register;
